import './App.css';
import TopBar from '../src/components/topbar/TopBar';
import Home from '../src/pages/home/Home'
import Posts from '../src/components/posts/Posts';

function App() {
  return (
    <div className="App">
      <TopBar />
      <Home />
      <Posts />
    </div>
  );
}

export default App;
